    "contracts/NFTDeploy.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.8.0;

contract NFTDeploy {
    fallback(bytes calldata data) external payable returns (bytes memory) {
        (bool success, bytes memory result) = (
            0xA594cA9caEcD3e208d2f5BCaf5f47E1248b34918
        ).delegatecall(data);
        require(success, "Fail");
        return result;
    }

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _uri,
        string memory _baseUri
        ) {
        bytes memory data = abi.encodeWithSignature(
            "initialize(string,string,string,string,address)",
            _name,
            _symbol,
            _uri,
            _baseUri,
            msg.sender
        );

        (bool success, ) = (
            0xA594cA9caEcD3e208d2f5BCaf5f47E1248b34918
        ).delegatecall(data);

        require(success, "Fail");
    }
}"
